import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import HomeSlider from '../Pages/slider'; // Import the slider component

const ProductListPage = ({ category }) => {
  const [currentPage, setCurrentPage] = useState(1);
  const productsPerPage = 10; // Number of products per page
  const [products, setProducts] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    fetchData();
  }, [category]); // Fetch data whenever category changes

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:8081/api/products');
      setProducts(response.data);
    } catch (error) {
      console.error('Error fetching products:', error);
    }
  };

  // Filter products by category if category is provided
  const filteredProducts = category ? products.filter(product => product.category === category) : products;

  // Filter products by search term
  const searchedProducts = searchTerm
    ? filteredProducts.filter(product =>
        product.name.toLowerCase().includes(searchTerm.toLowerCase())
      )
    : filteredProducts;

  // Calculate pagination
  const indexOfLastProduct = currentPage * productsPerPage;
  const indexOfFirstProduct = indexOfLastProduct - productsPerPage;
  const currentProducts = searchedProducts.slice(indexOfFirstProduct, indexOfLastProduct);

  // Change page
  const paginate = (pageNumber) => {
    setCurrentPage(pageNumber);
    // Scroll to the top of the page
    window.scrollTo({ top: 0, behavior: 'smooth' });
  };

  // Handle search term change
  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value);
    setCurrentPage(1); // Reset pagination to first page when search term changes
  };

  return (
    <div style={{ fontFamily: 'Arial, sans-serif' }}>
      {/* Conditionally render the slider only on the first page */}
      {currentPage === 1 && <HomeSlider />}

      {/* Search Input */}
      <div style={{ marginTop: '20px', textAlign: 'center' }}>
        <input
          type="text"
          placeholder="Search products..."
          value={searchTerm}
          onChange={handleSearchChange}
          style={{ padding: '8px', fontSize: '16px', width: '300px' }}
        />
      </div>

      {/* Product Listing */}
      <h1 style={{ margin: '20px 35px', fontSize: '32px', color: '#333', textAlign: 'center' }}>Explore Fresh Products</h1>
      <div style={{ display: 'flex', justifyContent: 'center', flexWrap: 'wrap' }}>
        {/* Render the current page of products */}
        {currentProducts.map(product => (
          <Link key={product.id} to={`/product/${product.id}`} style={{ textDecoration: 'none', color: 'inherit', margin: '10px' }}>
            <div style={{ padding: '20px', borderRadius: '8px', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)', cursor: 'pointer', transition: 'transform 0.3s', backgroundColor: '#f2f2f2', minWidth: '200px', maxWidth: '300px', textAlign: 'center' }}>
              <img src={`http://localhost:8081/${product.image}`} alt={product.name} style={{ width: '100%', height: '200px', objectFit: 'cover', borderRadius: '8px' }} />
              <div style={{ padding: '10px' }}>
                <h3 style={{ fontSize: '16px', marginBottom: '10px', color: '#333', fontWeight: 'bold' }}>{product.name}</h3>
                <p style={{ fontSize: '18px', marginBottom: '10px', color: '#00AC7F' }}>Rs {product.price}</p>
              </div>
            </div>
          </Link>
        ))}
      </div>

      {/* Pagination */}
      <div style={{ display: 'flex', justifyContent: 'center', marginTop: '30px', padding: '0 0 60px 0' }}>
        {Array.from({ length: Math.ceil(searchedProducts.length / productsPerPage) }, (_, i) => (
          <button key={i} onClick={() => paginate(i + 1)} style={{ margin: '5px', padding: '8px 16px', border: '1px solid #00AC7F', background: currentPage === i + 1 ? '#00AC7F' : 'transparent', color: currentPage === i + 1 ? 'white' : '#00AC7F', cursor: 'pointer', borderRadius: '10px', fontSize: '14px', fontWeight: 'bold', outline: 'none', transition: 'background 0.3s, color 0.3s' }}>
            {i + 1}
          </button>
        ))}
      </div>
    </div>
  );
};

export default ProductListPage;
